import React from "react";
import "./App.css";
import 'react-toastify/dist/ReactToastify.css';
import NavBar from 'react-responsive-menubar/lib/NavBar';

import Main from './Main';

function App() {



  return (
    <div className="App">
      <header className="header" style={{backgroundColor: "white"}}>
          <NavBar 
          logo={'https://i.hizliresim.com/fcgbduc.png'} 
          showSideNav={false} 
          logoStyles={{height:"70px", width:"100px", float: "left"}} 
          navBarStyles={{boxShadow:"none",}} 
          linkStyles={{color:"blue", fontWeight:"bold", float: "right"}}>

              <a className="navbarheader" href="/yemek">Yemekler</a>
              <a className="navbarheader" href="/icecek">Tatlılar</a>
              <a className="navbarheader" href="/tatlı">İçecekler</a>

          </NavBar>
      </header>
      <Main />
    </div>
  );
}

export default App;
